import React from 'react';
import Swim from "../assets/pic2.png";

function Hours() {
  return (
    <div className='hours'>
        <div className='hoursTop' style={{backgroundImage: `url(${Swim})`}}></div>
        <div className='hoursBottom'></div>
    </div>
  )
}

export default Hours
